import React from 'react'
import { useState } from 'react';
// import "../css/register.css"
// import background from '../pictures/back.jpg'
import {Link, useHistory} from "react-router-dom"
import { useUserAuth } from '../context2';


const Register = () => {
    const [email,setEmail]=useState("");
    const [password,setPassword]=useState("");
    const [error,setError]=useState("");
    const {signUp}=useUserAuth();
    const navigate=useHistory();
  
    const handle = async (e) => {
      e.preventDefault();
      setError("");
      try {
          await signUp(email,password)
          navigate.push('/payments');
          
      } catch (err) {
          setError(err.message);
      }
  };
    
  return (
   <>
    <div className='containerreg'>

   
    <div className="container">

<h1>Welcome</h1><br></br>
<h2> Manage You Task Checklist Easily</h2><br></br>
<h4>Email</h4>
<input type="email" placeholder="Enter your email" onChange={(e)=>setEmail(e.target.value)} /><br></br>

<h4>Password</h4>
<input type="password" placeholder="Enter your password" onChange={(e)=>setPassword(e.target.value)} /><br></br>

<button >Create account </button>

<p>Already have an account? </p> 



<Link to="/">Login</Link>
 
<h2>OR</h2>

<div >
<GoogleButton className="Google" > </GoogleButton>


</div>
</div>
</div>

   </>     
  )
}

export default Register
